function m(t){var a=Math.floor(t/31536e3),e=Math.floor(t%31536e3/86400),r=Math.floor(t%31536e3%86400/3600),n=Math.floor(t%31536e3%86400%3600/60),o=t%31536e3%86400%3600%60,u=[[a,"年"],[e,"天"],[r,"时"],[n,"分"],[Math.round(o),"秒"]];return u.filter(i=>i[0]).map(i=>""+i[0]+i[1]).join("")}function h(t){return new Date(t).toLocaleString("zh-Hans-CN",{year:"numeric",month:"2-digit",day:"2-digit",hour:"2-digit",minute:"2-digit",second:"2-digit",fractionalSecondDigits:3,hourCycle:"h23",timeZone:"Asia/Shanghai"}).replace(" ","T").slice(0,-4)}function d(t){return new Date(t).toLocaleString("zh-Hans-CN",{hour:"2-digit",minute:"2-digit",second:"2-digit",timeZone:"UTC"})}export{d as a,m as s,h as t};
